import React, { Component } from 'react';
import axios from 'axios';

class Create extends Component {
    constructor(props) {
        super(props);

        this.state = {
            username: '',
            password: '',
        };
    }

    handleInputChange = e => {
        this.setState({
            [e.target.name]: e.target.value,
        });
    };

    handleSubmit = e => {
        e.preventDefault();

        // console.log("happy")
        const { username , password } = this.state;


        const account = {
            username,
            password,
        };

        console.log(account);


        axios.post('http://localhost:3000/auth', account)
            .then((res) => console.log('data send'))
            .catch(err => {
                console.error(err.status);
            });

        this.setState({ name: '', email: '' })

    };

    render() {
        return (
            <div>
                <br />
                <div className="container">

                        <div className="login-form">
                            <h1>Login Form</h1>
                            <form onSubmit={this.handleSubmit}>
                                <input type="text" name="username" placeholder="Username" required onChange={this.handleInputChange}/>
                                    <input type="password" name="password" placeholder="Password" required onChange={this.handleInputChange}/>
                                        <input type="submit"/>
                            </form>
                        </div>
                </div>
            </div>
        );
    }
}

export default Create;
